import React,{Fragment,useEffect} from 'react';
import {BrowserRouter as Router,Route,Switch} from 'react-router-dom'
import './App.css';
import NavBar from './components/layout/NavBar';
import Landing from './components/layout/Landing';
import Login from './components/auth/Login';
import Register from './components/auth/Register';
import Alert from './components/layout/Alert';
import Dashboard from './components/dashboard/Dashboard';
import PrivatRoute from './components/routing/PrivateRoute';
import CreateProfile from './components/profile-forms/CreateProfile';
import AddExperience from './components/profile-forms/EditProfile';
import EditProfile from './components/profile-forms/AddExperience';
import AddEducation from './components/profile-forms/AddEducation';
import Profiles from './components/profiles/Profiles';
import Profile from './components/profile/Profile';
//Redux
import {Provider} from 'react-redux';
import store from './store';
import {loadUser} from './actions/auth';
import setAuthToken from './utils/setAuthToken';




if (localStorage.token) {
  setAuthToken(localStorage.token)
}

const App = () => {

useEffect(() =>{
store.dispatch(loadUser())
},[]);

  return(
<Provider store={store}>
 <Router>
    <Fragment>
      <NavBar/>
      <Route exact path='/' component={Landing}/>
      <section className="container">
        <Alert/>
        <Switch>
          <Route exact path='/register' component={Register}/>
          <Route exact path='/login' component={Login}/>
          <Route exact path='/profile/:id' component={Profile}/>
          <Route exact path='/profiles' component={Profiles}/>

         <PrivatRoute exact path='/dashboard' component={Dashboard}/>
         <PrivatRoute exact path='/create-profile' component={CreateProfile}/>
         <PrivatRoute exact path='/edit-profile' component={EditProfile}/>
         <PrivatRoute exact path='/add-experience' component={AddExperience}/>
         <PrivatRoute exact path='/add-education' component={AddEducation}/>
        </Switch>
      </section>
    </Fragment>
  </Router>
  </Provider>
  )}   


export default App;
